import React, { useState, useEffect } from 'react';

import axios from 'axios';
import '../../App.css';

export function Users() {

  const [response, setResponse] = useState(null)

  useEffect(async() => {
    const response = await axios.get("http://127.0.0.1:8000/api/users")
    const {data} = response
    setResponse(response)
  }, [])

  return (
    <>
    <h1>Users</h1>
    <div className="users--card"> 
      <div>{response?.data[2].avatar}</div>

      <div>{response?.data[2].login}</div>
      <div>{response?.data[2].name}</div>
      <div>{response?.data[2].email}</div>
      <div>{response?.data[2].rating}</div>
      <div>{response?.data[2].created_at}</div>
      <div>{response?.data[2].updated_at}</div>
    </div>
    </>
  );
}

export default Users;
